import React from "react";
import Home from "./Home";
import { Switch,BrowserRouter as Router, Route, NavLink } from 'react-router-dom';


const App=()=>{
    return(
        <Switch>
            <Route exact path="/" component={Home}/>
            <Route exact path="/About"/>
        </Switch>
    );
}
export default App;
